n        // Using mix to blend previous color with another color\n        // based on the output of the rect function\n        color = mix(color, yellow, rect(uv, vec2(-0.3, 0.3), vec2(0.25, 0.25), 0.0));\n        color = mix(color, blue, rect(uv, vec2(-0.3, 0.0), vec2(0.25, 0.25), 0.5));\n        color = mix(color, pink, rect(uv, vec2(-0.3, -0.3), vec2(0.25, 0.25), 1.5));\n\n        color = mix(color, blue, rect(uv, vec2(0.0, 0.3), vec2(0.25, 0.25), 3.0));\n        color = mix(color, pink, rect(uv, vec2(0.0, 0.0), vec2(0.25, 0.25), 2.5));\n        color = mix(color, yellow, rect(uv, vec2(0.0, -0.3), vec2(0.25, 0.25), 2.0));\n\n        color = mix(color, pink, rect(uv, vec2(0.3, 0.3), vec2(0.25, 0.25), 3.5));\n        color = mix(color, yellow, rect(uv, vec2(0.3, 0.0), vec2(0.25, 0.25), 4.0));\n        color = mix(color, blue, rect(uv, vec2(0.3, -0.3), vec2(0.25, 0.25), 4.5));\n\n        gl_FragColor = vec4(color, 1.0);\n    }\n\n"},zr={src:"\n\n    precision mediump float;\n\n    uniform vec2 u_resolution;\n    uniform float u_time;\n\n    const float PI = 3.14159265359;\n\n    // rectangle that starts at bottom left\n    float rect(vec2 p, vec2 pos, vec2 size) {\n        vec2 bl = step(pos, p);\n        // Subtracting from 1.0 to invert coordinates and the top right values\n        vec2 tr = step(1.0 - pos - size, vec2(1.0 - p));\n        return bl.x * bl.y * tr.x * tr.y;\n    }\n\n    void main () {\n        // y: 0.0 to 1.0\n        // x: 0.0 to xMax\n        vec2 p = gl_FragCoord.xy / u_resolution.y;\n        // Storing xMax so it can easily be used in positional functions\n        float xMax = u_resolution.x / u_resolution.y;\n\n        vec3 cBlue = vec3(0.016, 0.016, 0.627);\n        vec3 cWhite = vec3(0.984, 0.988, 0.957);\n        vec3 cGray = vec3(0.102, 0.078, 0.078);\n        vec3 cBlack = vec3(0.008, 0.008, 0.0);\n        vec3 cRed = vec3(0.969, 0.0, 0.016);\n        vec3 cYellow = vec3(0.85, 0.85, 0.0);\n\n        vec3 c = cWhite;\n        // Increment